import React from 'react';

// material-ui
import { CardContent, FormControl, FormControlLabel, Grid, Card, Radio, RadioGroup, TextField} from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from 'ui-component/cards/SubCard';
import MaskedInput from 'react-text-mask';

import { makeStyles } from '@material-ui/styles';


const useStyles = makeStyles((theme) => ({
    card: {
        backgroundColor: theme.palette.mode === 'dark' ? theme.palette.dark[800] : theme.palette.primary.light,
        marginBottom: '16px',
        marginTop: '16px'
    }
}));



const CaseManagementDecision = () => {
    const classes = useStyles();
    const [valueLabel, setValueLabel] = React.useState('checked');

    return (
        <Card className={classes.card} title='Client Case Management Decision'>
            <CardContent>
                <Grid container spacing={3} direction="column">
                    <Grid item>
                        <FormControl>
                            <RadioGroup
                                row
                                aria-label="gender"
                                value={valueLabel}
                                onChange={(e) => setValueLabel(e.target.value)}
                                name="row-radio-buttons-group"
                            >
                                <FormControlLabel value="checked" control={<Radio />} label="Client is accepted in the Case Management Program" />
                                <FormControlLabel value="unchecked" control={<Radio />} label="Client is refused for the Case Management Program" />
                            </RadioGroup>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            fullWidth
                            maxRows={4}
                            id="outlined-textarea"
                            label="Reason for Client Refusal"
                            placeholder="Placeholder"
                            multiline
                        />
                    </Grid>
                </Grid>
            </CardContent>
        </Card>
    );
};

export default CaseManagementDecision;
